                //browser.GetMainFrame().LoadUrl(((CefRequest)request).Url);
                browser.GetMainFrame().LoadRequest((CefRequest)request);
                //browser.Reload();
                //browser.SendProcessMessage(CefProcessId.Renderer, CefProcessMessage.Create("LoadRequest"));
                OnNavigated();
            }
        }

