 this.canvasCtx.restore();              },              /**               * Set the highscore as a array string.               * Position of char in the sprite: H - 10, I - 11.               * @param {number} distance Distance ran in pixels.               */              setHighScore: function(distance) {                distance = this.getActualDistance(distance);                var highScoreStr = (this.defaultString +                    distance).substr(-this.maxScoreUnits);                this.highScore = [\'10\', \'11\', \'\'].concat(highScoreStr.split(\'\'));              },              /**               * Reset the distance meter back to \'00000\'.               */              reset: function() {                this.update(0);                this.acheivement = false;              }            };            //******************************************************************************            /**             * Cloud background item.             * Similar to an obstacle object but without collision boxes.             * @param {HTMLCanvasElement} canvas Canvas element.             * @param {Object} spritePos Position of image in sprite.             * @param {number} containerWidth             */            function Cloud(canvas, spritePos, containerWidth) {              this.canvas = canvas;              this.canvasCtx = this.canvas.getContext(\'2d\');              this.spritePos = spritePos;              this.containerWidth = containerWidth;              this.xPos = containerWidth;              this.yPos = 0;              this.remove = false;              this.cloudGap = getRandomNum(Cloud.config.MIN_CLOUD_GAP,                  Cloud.config.MAX_CLOUD_GAP);              this.init();            };            /**             * Cloud object config.             * @enum {number}             */            Cloud.config = {              HEIGHT: 14,              MAX_CLOUD_GAP: 400,              MAX_SKY_LEVEL: 30,              MIN_CLOUD_GAP: 100,              MIN_SKY_LEVEL: 71,              WIDTH: 46            };            Cloud.prototype = {              /**               * Initialise the cloud. Sets the Cloud height.               */              init: function() {                this.yPos = getRandomNum(Cloud.config.MAX_SKY_LEVEL,                    Cloud.config.MIN_SKY_LEVEL);                this.draw();              },              /**               * Draw the cloud.               */              draw: function() {                this.canvasCtx.save();                var sourceWidth = Cloud.config.WIDTH;                var sourceHeight = Cloud.config.HEIGHT;                if (IS_HIDPI) {                  sourceWidth = sourceWidth * 2;                  sourceHeight = sourceHeight * 2;                }                this.canvasCtx.drawImage(Runner.imageSprite, this.spritePos.x,                    this.spritePos.y,                    sourceWidth, sourceHeight,                    this.xPos, this.yPos,                    Cloud.config.WIDTH, Cloud.config.HEIGHT);                this.canvasCtx.restore();              },              /**               * Update the cloud position.               * @param {number} speed               */              update: function(speed) {                if (!this.remove) {                  this.xPos -= Math.ceil(speed);                  this.draw();                  // Mark as removeable if no longer in the canvas.                  if (!this.isVisible()) {                    this.remove = true;                  }                }              },              /**               * Check if the cloud is visible on the stage.               * @return {boolean}               */              isVisible: function() {                return this.xPos + Cloud.config.WIDTH > 0;              }            };            //******************************************************************************            /**             * Nightmode shows a moon and stars on the horizon.             */            function